import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { falinkedin, faGithubsquare } from '@fortawesome/free-solid-svg-icons';

const Footer = () => {
    return (
        <div className="footer">

            <p>Phone: <a href="tel:214-738-3535">(214) 738-3535</a> | Email: legessebl@gmail.com | 
            <FontAwesomeIcon className="icon" icon={falinkedin} size="2x" />
            <a href="https://www.linkedin.com/in/bethelhem-legesse-2021/" target="_blank"> Linkedin | </a>
            <FontAwesomeIcon className="icon" icon={faGithubsquare} size="2x" />
            <a href="https://github.com/blegesse-git" target="_blank">GitHub</a></p>




        </div>

    )
}

export default Footer
